import React from "react";
import Navbar from "../Navbar";

export default function Home() {
    return (
        <>
            <Navbar />
            <div className="container text-center">
                <h1 className="display-4 py-3">Create Table</h1>

                <form className="">
                    <div>
                        <input></input>
                        <input type="image" className="ps-3 h-100" src="plus-square.svg" alt="add table"></input>
                    </div>
                </form>


            </div>

        </>
    )
}
